import React from "react";
import Header from "./Header";
import BodyInnerContainer from "./BodyInnerContainer";
import Sidebar from "./Sidebar";

const Home = () => {
    return(
        <div>
            <Header />
            <div className='body_container'>
                <Sidebar />
                <BodyInnerContainer />
            </div>
        </div>
    )
}

export default Home
